func numberOfAlternatingGroups(colors []int, k int) int {
	n := len(colors)
	res := 0
	// 计数，当前连续的个数
	cnt := 1
	for start := 0; start < n+k-2; start++ {
		i := start % n
		j := (start + 1) % n
		if colors[i]^colors[j] == 1 {
			cnt++
		} else {
			cnt = 1
		}

		if cnt >= k {
			res++
		}
	}

	return res
}
func timeCost(f func()) {
	s := time.Now()
	f()

	tc := time.Since(s)

	log.Printf("time COST %v\n", tc)
}

func numberOfAlternatingGroupsTwo(colors []int, k int) int {
	n := len(colors)
	res := 0

	// 滑动窗口检查每个子区间
	for start := 0; start < n; start++ {
		isPass := true
		for i := 1; i < k; i++ {
			// 计算两个相邻元素是否交替
			if colors[(start+i-1)%n]^colors[(start+i)%n] != 1 {
				isPass = false
				break
			}
		}

		if isPass {
			res++
		}
	}

	return res
}
